      <Form className="m-5">
        <Form.Group controlId="formBasicEmail">
          <Form.Label>Post title</Form.Label>
          <Form.Control
            type="email"
            placeholder="add the title"
            className="mt-2 mb-5"
          />
        </Form.Group>

        <Button variant="primary" type="submit" style={{}}>
          Add
        </Button>
      </Form>
    </div>
  );
};

export default AddPost;
